ControlPropertyState.AutoRuleBindingString:
//get the description from the product
UpdateContext({NewDescription: PowerAppsforAppMakers.GetApp(vSelectedApp.App).properties.description});

//if not Blank, update collection, inventory, and current selection
If(!IsBlank(NewDescription), 
    UpdateIf(myApps, App=vSelectedApp.App, {'App Description': NewDescription});
    UpdateIf('PowerApps Apps', App=vSelectedApp.App, {'App Description': NewDescription});
    Set(vSelectedApp, LookUp(myApps, App=vSelectedApp.App));
    )
